  sensors on the NOAA ship Ronald H. Brown during the \"North Atlantic Stepping Stones
  2005\" expedition sponsored by the National Oceanic and Atmospheric Administration
  (NOAA) Office of Ocean Exploration, August 7 through September 3, 2005. Measurements
  include ship's position and heading, air temperature, relative humidity, barometric
  pressure, wind speed and direction, chlorophyll, sea surface temperature, and salinity.
